export default [

    //HEMSTÄD
    //SOVRUM

    {
        text: "Plocka undan saker. T.ex leksaker, kläder mm. Bädda, vik plädar, puffa kuddar"
    },
    {
        text: "Torka eluttag, lister, trösklar, fönsterbrädor, nattduksbord, hyllor, lampor"
    },
    {
        text: "Putsa speglar"
    },
    {
        text: "Garderob och skåp rengörs utvändigt"
    },
]
